import React, { useState, useEffect } from "react";
import { Container, Row, Col } from "react-bootstrap";
import { Link } from "react-router-dom";

function Footer() {
  // Scroll State
  const [isVisible, setIsVisible] = useState(false);
  const scrollTop = () => {
    window.scrollTo({
      top: 0,
      behavior: "smooth",
    });
  };

  const listenToScroll = () => {
    let heightToHidden = 250;
    const windowScroll =
      document.body.scrollTop || document.documentElement.scrollTop;

    windowScroll > heightToHidden ? setIsVisible(true) : setIsVisible(false);
  };

  useEffect(() => {
    window.addEventListener("scroll", listenToScroll);
  });
  return (
    <>
      <footer>
        <Container className="center-container">
  <Row>
    <Col sm={6} lg={3} className="mb-4 mb-lg-0 center-text">
      <div>
        <h5>Developed By</h5>
        <p>Abhay Sharma</p>
        <p>Dev Sanskriti Vishwavidyalaya</p>
        <p>Shantikunj Haridwar</p>
      </div>
    </Col>

    <Col sm={6} lg={3} className="mb-4 mb-lg-0 center-text">
      <div>
        <h5>Follow Me</h5>
        <p>Quaerat neque purus ipsum</p>
        <ul className="list-unstyled mt-2 d-flex justify-content-center gap-3">
          <li>
            <Link to="/">
              <i className="bi bi-facebook"></i>
            </Link>
          </li>
          <li>
            <Link to="/">
              <i className="bi bi-twitter"></i>
            </Link>
          </li>
          <li>
            <Link to="/">
              <i className="bi bi-instagram"></i>
            </Link>
          </li>
          <li>
            <Link to="/">
              <i className="bi bi-youtube"></i>
            </Link>
          </li>
        </ul>
      </div>
    </Col>
  </Row>

  <Row className="copy_right mt-4">
    <Col>
      <div>
        <ul className="list-unstyled text-center mb-0">
          <li>
            <Link to="/">
              © 2023 <span>CODE4EDUCATION</span>. All Rights Reserved
            </Link>
          </li>
          <li>
            <Link to="/">About Us</Link>
          </li>
          <li>
            <Link to="/">Terms Of Use</Link>
          </li>
          <li>
            <Link to="/">Privacy Policy</Link>
          </li>
        </ul>
      </div>
    </Col>
  </Row>
</Container>

      </footer>

      {/* Sroll To Top */}
      {isVisible && (
        <div className="scroll_top" onClick={scrollTop}>
          <i class="bi bi-arrow-up"></i>
        </div>
      )}
    </>
  );
}

export default Footer;
